import {gql} from 'apollo-boost';
import {graphql} from 'react-apollo';
import { variablesInOperation } from 'apollo-utilities';

const BookDetailsQuery = gql`
{
    books{
        name
        id
    } 
 }

`

class BookDetails extends Component{
  
 render(){
     
     
     return(
         <div>
           <h2>Book Details</h2>

         </div>
     )
 }
}

export default graphql(BookDetailsQuery, {
    name:"BookDetailsQuery",
    options:()=>{
        return{
            variables:{
                id:Bo
            }
        }
    }
})(BookDetails)
